import React, { useEffect, useState } from 'react'
import DataTable from '../common/DataTable/DataTable';

const columns = [
    { field: 'id', headerName: 'id', width: 20 },
    { field: 'title', headerName: 'title', width: 150 },
    { field: 'year', headerName: 'year', width: 150 },
    { field: 'genre', headerName: 'genre', width: 200 },
    { field: 'director', headerName: 'director', width: 150 },
    { field: 'actors', headerName: 'actors', width: 200 ,scroll:true },
    { field: 'rating', headerName: 'rating', width: 200 },
];

const movieTableStyles = {
    height: '650px'
};

const UserTable = ({ onError }) => {
    const [movies, setUsers] = useState([]);
    useEffect(() => {
        fetch('https://d5ejp96hg6.execute-api.us-east-1.amazonaws.com/getMovieApi')
            .then((response) => response.json())
            .then((json) => setUsers(json))
            .catch(() => onError())
    }, []);

    return (
        <DataTable
            rows={movies}
            columns={columns}
            loading={!movies.length}
            sx={movieTableStyles}
        />
    );
};

export default UserTable
